import React from "react";
import './App.css';


function App() {
    return (
        <divc className='app-wrapper'>
            <header className='header'>
                <img
                    src='https://image.shutterstock.com/image-vector/mountain-vector-icon-isolated-on-260nw-1199231911.jpg'/>
            </header>
            <nav className='nav'>
                <div>
                    Profile
                </div>
                <div>
                    Messages
                </div>
            </nav>
            <div>
                Main content
            </div>

        </divc>
    );
}

export default App;
